import React, { useState, useEffect } from "react";
import API from "../../utils/API";

function Day() {
  const [currentBooking, setCurrentBooking] = useState(["hi", "hi"]);
  useEffect(() => {
    const date = "2021-05-12";
    API.getBookings(date).then((res) => {
      console.log(res.data);
      setCurrentBooking(res.data);
      log();
    });
  }, []);

  const log = () => {
    console.log(currentBooking);
  };

  return (
    <div>
      <table class="table table-hover">
        <thead>
          <tr>
            <th scope="col">Title</th>
            <th scope="col">description</th>
            <th scope="col">date</th>
            <th scope="col">time</th>
          </tr>
        </thead>
        <tbody></tbody>
        {currentBooking.map((booked) => {
          return (
            <tr class="table-info" key={booked.id}>
              <th scope="row">{booked.title}</th>
              <td>
                {booked.description}
                Lorem ipsum dolor, sit amet consectetur adipisicing elit.
                Placeat repudiandae hic eligendi et, perferendis excepturi
                voluptate ad nisi incidunt impedit architecto in dicta ipsam
                aliquid quaerat at tenetur accusamus provident similique iure
                quos quia dolores temporibus voluptatibus. Accusantium nemo
                soluta nihil aliquam. Esse laudantium, id debitis optio quam
                ducimus iure?
              </td>
              <td>{booked.date}</td>
            </tr>
          );
        })}
      </table>
    </div>
  );
}

export default Day;
